import React from 'react'

import './sub-header.css'

const SubHeader = () => {
  return (
    <h1 className="sub-header">
      Hi, I'm Amelia! I'm a <span className='frontend-span'>Frontend Developer</span> located in Gothenburg.
    </h1>
  )
}

export default SubHeader
